          </CardDescription>
        </Item>
        <Item>
          <CardImage src={""} alt="" />
          <CardDescription>
            <h1
              style={{
                fontSize: "20px",
                marginBottom: "-20px",
                padding: "0",
                fontWeight: "bold",
              }}
            >
              Crypto Market Tracker
            </h1>
            <br /> Libraries Used:
            <br />- Axios [For API]
            <br />- Framer Motion[Animation]
            <br />- Styled-Components[CSS]
          </CardDescription>
        </Item>
      </Card>
    </AppProvider>
  );
}

export default Verticalscroll;
